import React, { useState } from "react";
import cover from "../../assets/cover1.jpg";
import axios from 'axios';

export default function Result ({history}) {
  
  const input = history.location.state[0]
  const [result, setResult] = useState(['Score', 'Unknown']);

    // http://coronavirus-diagnosis.us-west-1.elasticbeanstalk.com
    try {
      const res = axios.post('http://localhost:5000/data', {'cool': 'fool'}, 
      {
        headers: {'Content-Type': 'application/json',},
      }).then(res => {
        var arr = []
        for (var key in res['data']) {
          arr.push(res['data'][key])
          setResult(arr)
          console.log(res)
        }
      })
    }catch (error) {
      console.log(error);  
    }

  return (
    <div className="formContainer">
      <div className="formButtonView">
        <h1 style={{marginLeft:"2.5em", color: "white"}}>{result.join(' ')}</h1>
        <br />
        <br />
        <button className="sideButton" onClick={() => history.push("/")}>Home</button>
      </div>
      <img src={cover} className="cover1" />
    </div>
  );
}
